tables.table_schema:
CREATE TABLE market_price_data (
    id INT PRIMARY KEY,
    symbol VARCHAR(10),
    price DECIMAL(10, 2),
    time TIMESTAMP
);

CREATE TABLE trading_volume_data (
    id INT PRIMARY KEY,
    symbol VARCHAR(10),
    volume INT,
    time TIMESTAMP
);

CREATE TABLE market_data (
    date DATE,
    price FLOAT,
    volume INT
);

CREATE TABLE price_fluctuations (
    date DATE,
    high_price FLOAT,
    low_price FLOAT,
    close_price FLOAT
);

CREATE TABLE trading_volume (
    date DATE,
    volume INT,
    transaction_count INT
);
